import React from 'react';
import './Phone.css';

class Phone extends React.Component{
  render(){
    return(
      <div className="textGb">
        <div className="headerPh">
          <div className="headerCt">Phone Number</div>
          <div className="phoneKeyboardContainer">
            <div className="stepBack textColor">
              <a href="#">
                <svg class="am-icon am-icon-back am-icon-md text-main">
                  <use xlinkHref="#back"></use>
                </svg>
                Back
              </a>
            </div>
            <div className="stepNext textColor"></div>
            <div className="phoneKeyboard"></div>
          </div>
        </div>
      </div>
    )
  }
}

export default Phone;
